import React from "react";
import "../CSS/Delivery.css";

function Delivery({ timeString, kind, manName, where }) {
  if (manName === "") {
    return (
      <div className="delivery">
        <div>{timeString}</div>
        <div>상태: {kind}</div>
        <div>위치: {where}</div>
      </div>
    );
  } else {
    return (
      <div className="delivery">
        <div>{timeString}</div>
        <div>상태: {kind}</div>
        <div>
          위치/배송인: {where}/{manName}
        </div>
      </div>
    );
  }
}
export default Delivery;
